@ohitslul #perbedaanmakna:
- mengembangkan → pengembangan: Pengembangan istilah suatu bidang dilakukan oleh @BadanBahasa dengan bantuan ahli pada bidang itu.
- berkembang → perkembangan: Perkembangan istilah mesti sejalan dengan perkembangan ilmu dan teknologi.

Ada beberapa istilah puspa:

puspa bangsa: melati;
puspa citra: melati;
puspa nusa: raflesia;
puspa hati: buah hati, kekasih;
puspa pesona: anggrek bulan.

